import React, { Component } from 'react'
import Typography from '@material-ui/core/Typography'
import './RequestsList.css'

interface Idata{
    title?: string,
    teacher?: string,
    deadline ?: string,
    scienceArea?: string,
    description?: string,
    reportFile?: string,
    presentationFile?: string,
    consultantReportFile?: string,
    link?: string,
    teacherContacts?: string,
    consultant?: string,
    consultantContacts?: string,
    critic?: string,
    status?: string,
    id?: number
}

interface Props{
    data: {}[],
    changePage(event : React.MouseEvent<HTMLButtonElement>) : void,
}

interface State{

}

class RequestsList extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderItem(item : Idata){
        return(
            <div className='requestItem'>
                <div className='inline'><Typography variant='h6'>{item.title}, {item.teacher}</Typography></div>
                <button
                    className='more inline'
                    value={item.id!.toString()} 
                    onClick={this.props.changePage} 
                ><Typography variant='button'>Подробнее</Typography>
                </button>
            </div>
            )
    }

    private renderRequestsList(){
        return(
            <div>
        {this.props.data.map(item => this.renderItem(item))}
        <hr/>
        </div>
        )
    }

    render(){
        return this.renderRequestsList();
    }
}

export default RequestsList
